import React from 'react';
import { Form, Input, Button, List } from 'antd';

// 내 프로필
const Profile = () => {
    return(
        <div>
            <Form style={{margin:'20px', border:'1px solid #ccc', padding:'20px'}}>
                <Input addonBefore='닉네임' />
                <Button type='primary'>수정</Button>
                <List 
                    style={{margin:'20px'}}
                />
            </Form>
        </div>
    );
}

export default Profile;
